import React from "react";
import { Link } from "react-router-dom";
import { useEffect } from "react";
import logo from "./logo.png";
import scanner from "./scanner.png";
import qrcode from "./qrcode.png";
export const Auth = () => {
    useEffect(() => {
        setTimeout(() =>{
            window.location.replace('http://localhost:1234/loading/');
        },3000);
    },[]);
    return(
        <>
        <img src={logo} alt="" className="alogo"/>
        <Link to={"/home/"}><a className="cancel">cancel</a></Link><br/>
        <div className="classes">
            <div className="class1">
                <img src={qrcode} alt="" className="image" />
                <p className="qr">Please place finger<br/>on scanner</p>
            </div>
            
            <div className="class2">
            <img  src={scanner} className="image" />
                <p className="qr">Please place Aadhaar<br/> QR code on scanner</p>
            </div>
        </div>
        </>
    );
}
